// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Default from './Pages/Default';
import Login from './Pages/Login';
import Test from './Pages/Test';
import Test2 from './Pages/Test2'; // Import the Test2 component
import { useAuth } from './context/AuthContext';

const App = () => {
  const { isLoggedIn } = useAuth();

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Default />} />
        <Route path="/login" element={<Login />} />
        {isLoggedIn ? (
          <>
            <Route path="/Test" element={<Test />} />
            <Route path="/Test2" element={<Test2 />} /> {/* Add the Test2 route */}
          </>
        ) : (
          <>
          <Route path="/Test" element={<p>Please log in to access this page.</p>} />
          <Route path="/Test2" element={<p>Please log in to access this page.</p>} />
          </>
        )}
      </Routes>
    </Router>
  );
};

export default App;
